import logo from "./logo.svg";
import "./App.css";
import PolicySelection from "./components/PolicySelection";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <PolicySelection />
        <h1 className="text-3xl font-bold underline text-red-800">
          Hello world!
        </h1>
      </header>
    </div>
  );
}

export default App;
